import React, { Component } from 'react';


import './App.css';

import {
    BrowserRouter as Router,
    Route,
    Link

}from 'react-router-dom';
import citrus1 from './components/main/mainImg/citrus2.png';


//components
import Header from './components/headerComponent/header.js';
import MainContent from './components/main/mainContent.js';
import DateList from './components/dates/dateList.js';


class App extends Component {
  render() {
    return(

        <Router>
    <div className="App">
        <div className="citrus1" ><img src={citrus1}/></div>

        <Route exact path ='/' component={MainContent}/>

        <Route exact path ='/dates' component={DateList}/>

    </div>

        </Router>
  );
  }
}

export default App;
